import React from 'react';
import ReactDOM from 'react-dom';
import Menu from './Menu.js'
import Logo from './Logo.js'
import './Menu.css'
import './Logo.css'

class Header extends React.Component {
  render() {
    return (
      <div id="HEADER" class="container-fluid mb-5 ">
        <Menu />
        <Logo />
      </div>
    );
  }
}

export default Header;
